} The for loop statement can be modified with the while condition, which will be checked before each iteration of the loop. The while condition expression has access to the loop iterator variable. let x = 7; for i in 0..10 while i % x != 2 { // do something
}; Only constant expressions can be used as the bounds of the iterator range. The while condition will not cause an early return, but it will suppress the loop body side effects. Zinc is a Turing-incomplete language, as it is dictated by R1CS restrictions, so loops always have a fixed number of iterations. On the one hand, the loop counter can be optimized to be treated as a constant, reducing the circuit cost, but on the other hand, you cannot force a loop to return early, increasing the circuit cost.

