use crate::constants::ZERO;
use crate::constants::PRECISION_MUL;
use crate::constants::N; ///
/// The token being withdrawn balance after the swap.
///
pub fn after( tokens: [TokenAddress; N], balances: [Balance; N], amplifier: u64, token_x_idx: u8, token_y_idx: u8, after_x: Balance,
) -> Balance { require(token_x_idx != token_y_idx, "Cannot exchange between the same coins"); let mut balances_p = balances; for i in 0..N { balances_p[i] *= tokens[i].magnitude_diff() * PRECISION_MUL; } let D = crate::invariant::calculate(balances_p, amplifier); let An: Balance = amplifier * (N as u64); let x_magnitude_diff = tokens[token_x_idx].magnitude_diff() * PRECISION_MUL; let y_magnitude_diff = tokens[token_y_idx].magnitude_diff() * PRECISION_MUL; let mut c = D; let mut S: Balance = ZERO; for i in 0..N { if i == token_x_idx as u8 { let after_x_p = after_x * x_magnitude_diff; S += after_x_p; c = c * D / (after_x_p * (N as Balance)); } else if i != token_y_idx as u8 { S += balances_p[i]; c = c * D / (balances_p[i] * (N as Balance)); }; } c = c * D / (An * (N as Balance)); let b: Balance = S + D / An; let mut y = D; let mut y_next = y; let mut y_done = false; for n in 0..15 while !y_done { y_next = (y * y + c) / (2 * y + b - D); let is_next = (y > y_next && y - y_next > y_magnitude_diff) || (y <= y_next && y_next - y > y_magnitude_diff); if is_next { y = y_next; } else { y_done = true; }; } y / y_magnitude_diff
